import { Outlet } from "react-router-dom";

function Blog() {
  return (
    <div className='page-wrapper'>
        <Header isUserAthanticated={prop.isUserAthanticated} headerTheam="header headerWhite" logoAvtar="images/logoBlack.png"/>
      <div class="container">
        <h1 className="text-center mt-5">Blog page</h1>
        <Outlet />
      </div>
    </div>
  );
}

export default Blog;
